import React, { useEffect, useState, useContext } from "react";
import { StyleSheet, Text, View, Image, ScrollView, TouchableWithoutFeedback, StatusBar, Alert, TouchableOpacity, FlatList, RefreshControl, TextInput } from "react-native";
import axios from "axios";
import Ionicons from "react-native-vector-icons/Ionicons";
import TokenContext from "../context/AuthContext";
import UserContext from "../context/UserContext";
import { useNavigation } from "@react-navigation/native";
import GridImageView from 'react-native-grid-image-viewer';

export default function Search() {

  const [name, setName] = useState([]);
  const [results, setResults] = useState([]);
  const { token } = useContext(TokenContext);
  const IP = "10.144.1.15";

  useEffect(() => {
    searchPublications();
    console.log('resultados: ', results)
  }, [name])

  const searchPublications = async () => {
    await axios
      .get(`http://${IP}:4000/publicaciones/search/${name}`, {
        headers: {
          authorization: `Bearer ${token}`,
        },
      })
      .then((res) => {
        setResults(res.data);
      })
      .catch((err) => console.log(err));
  }

  return (
    <>
      <View style={styles.cuadrado}>
        <View style={{ flexDirection: "row" }}>
          <Ionicons name="search" color="#fff" size={20} style={{ padding: "2%" }} />
          <TextInput style={styles.input} placeholder="  What're you looking for?" onChangeText={(value) => { setName(value) }} />
          <Ionicons name="funnel" color="#fff" size={20} style={{ padding: "2%", marginLeft: "1.5%" }} />
        </View>
      </View>



      <View style={styles.app}>
        <GridImageView data={['data:image/jpeg;base64,',
          'data:image/jpeg;base64,',
          'data:image/jpeg;base64,',
          'data:image/jpeg;base64,',
          'data:image/jpeg;base64,']}
        />
      </View>
        <FlatList
          data={results}
          key={results.id}
          renderItem={({ item }) => {
            <>
              <Image source={item.image} style={styles.picture} />
              <Text>hola</Text>
            </>
          }}
        />
    </>
  )
}

const styles = StyleSheet.create({
  cuadrado: {
    justifyContent: "flex-start",
    marginTop: "10%",
    width: 435,
    zIndex: 2,
    height: 50,
    backgroundColor: "#80341E",
    borderBottomWidth: 7,
    borderColor: "#9D2932",
  },
  picture: {
    width: "100%",
    height: "100%"
  },
  input: {
    backgroundColor: "#fff",
    borderRadius: 20,
    width: "75%",
    height: 25,
    marginTop: "2.5%",


  },
  app: {
    backgroundColor: "#E49C7A",
    flex: 1
  }
});
